INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24001, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 2, 2, 401, 0.0, "アヤネ", 102301, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24002, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 2.21, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 1, 2, 402, 0.0, "アヤネ", 102301, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24003, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 2, 2, 403, 0.0, "アヤネ", 102301, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24004, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1.99, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 2, 1, 701, 0.0, "アサヒ", 192201, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24005, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2.21, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 1, 2, 702, 0.0, "アサヒ", 192201, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24006, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 3.33, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 2, 1, 703, 0.0, "アサヒ", 192201, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24007, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 2, 2, 801, 0.0, "部員３", 192301, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24008, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2.68, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 1, 2, 802, 0.0, "部員３", 192301, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24009, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 2, 2, 803, 0.0, "部員３", 192301, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24010, "やった！", 0.0, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 1, 1, 501, 0.0, "", 192501, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24011, "勝ったよ！", 0.0, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 1, 1, 502, 0.0, "", 192501, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24012, "いい調子！", 0.0, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 1, 1, 503, 0.0, "", 192501, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24013, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 5.33, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 6, 2, 111, 0.0, "ミサト", 113501, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24014, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 6.85, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 1, 2, 112, 0.0, "ミサト", 113501, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24015, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 3.0, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 1, 2, 113, 0.0, "ミサト", 113501, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24016, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 6.11, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 1, 2, 611, 0.0, "ダイチ", 192401, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24017, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 6.75, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 1, 2, 612, 0.0, "ダイチ", 192401, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24018, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 2, 2, 613, 0.0, "ダイチ", 192401, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24019, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 4.52, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 2, 1, 211, 0.0, "ハツネ", 113401, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24020, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 3.89, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 2, 1, 212, 0.0, "ハツネ", 113401, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24021, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 13.49, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 1, 2, 213, 0.0, "ハツネ", 113401, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24022, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 3.17, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 1, 2, 311, 0.0, "カヤ", 106501, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24023, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 4.42, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 1, 2, 312, 0.0, "カヤ", 106501, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24024, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 2.89, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 6, 1, 313, 0.0, "カヤ", 106501, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24025, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 3.71, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 4, 3, 421, 0.0, "アヤネ", 102301, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24026, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 5.1, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 2, 1, 721, 0.0, "アサヒ", 192201, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24027, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 4.34, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 1, 3, 821, 0.0, "部員３", 192301, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24028, "いい勝負だったよ\nまたやろうね", 0.0, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 1, 1, 521, 0.0, "", 192501, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24029, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 5.62, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 1, 2, 101, 0.0, "ミサト", 113501, -360.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24030, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 9.58, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 1, 2, 102, 0.0, "ミサト", 113501, -360.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24031, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 2, 2, 103, 0.0, "ミサト", 113501, -360.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24032, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 9.13, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 2, 1, 104, 0.0, "ミサト", 113501, -360.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24033, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 8.27, 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 1, 2, 105, 0.0, "ミサト", 113501, -360.0);
